import * as S from "./styles";
import ReactTyped from "react-typed";

const Introduction = () => {
  return (
    <S.Introduction>
      <h1>
        <ReactTyped sequence={(["I am Brianna"], 1000)} typeSpeed={150} loop />
      </h1>
      <h2>Junior FrontEnd Developer</h2>
    </S.Introduction>
  );
};

export default Introduction;
